INSERT INTO `productos` (`id`, `nombre`, `descripcion`, `precio`, `descuento`, `stock`, `id_categoria`, `activo`) VALUES
(21, 'Motor Brushless 2200kv', '<p>Potencia y eficiencia en un solo motor. Perfecto para drones y modelos de alta velocidad. Este motor brushless de 2200kV ofrece rendimiento superior y durabilidad. ¡Desata la velocidad!</p><p><strong>Aspectos Técnicos:</strong></p><ul><li>KV (RPM por Voltio): 2200kV</li><li>Tipo: Brushless (sin escobillas)</li><li>Eficiencia: Alta eficiencia energética</li><li>Aplicaciones: Drones, UAVs, Modelismo</li><li>Peso: Ligero para un mejor rendimiento</li></ul>', 100.00, 0, 0, 6, 1),
(22, 'Motor DC', '<p>Versátil y fiable, el Motor DC es ideal para tus proyectos de robótica y automatización. Compacto y potente, asegura un control preciso y eficiente. ¡Impulsa tus ideas con confianza!</p><p><strong>Aspectos Técnicos:</strong></p><ul><li>Tipo: Motor de Corriente Continua (DC)</li><li>Voltaje de Operación: 6V - 12V</li><li>Velocidad: Variable con control de voltaje</li><li>Aplicaciones: Robótica, Automatización, Pequeños dispositivos electrónicos</li><li>Construcción: Compacto y Duradero</li></ul>', 15.00, 0, 6, 6, 1),
(23, 'Arduino Uno', '<p>El Arduino Uno es la plataforma perfecta para tus proyectos electrónicos. Fácil de usar y versátil, con 14 pines digitales, 6 entradas analógicas y un puerto USB. ¡Empieza a crear hoy mismo!</p><p><strong>Aspectos Técnicos:</strong></p><ul><li>Microcontrolador: ATmega328P</li><li>Pines Digitales I/O: 14 (6 PWM)</li><li>Entradas Analógicas: 6</li><li>Velocidad del Reloj: 16 MHz</li><li>Conexión: USB tipo B</li><li>Voltaje de Operación: 5V</li></ul>', 75.00, 0, 0, 9, 1),
(24, 'Arduino nano', '<p>Compacto pero poderoso, el Arduino Nano es ideal para proyectos donde el espacio es limitado. Con 14 pines digitales y 8 entradas analógicas, lleva tus ideas al siguiente nivel con facilidad.</p><p><strong>Aspectos Técnicos:</strong></p><ul><li>Microcontrolador: ATmega328</li><li>Pines Digitales I/O: 14 (6 PWM)</li><li>Entradas Analógicas: 8</li><li>Velocidad del Reloj: 16 MHz</li><li>Conexión: Mini USB</li><li>Voltaje de Operación: 5V</li></ul>', 50.00, 0, 28, 9, 1),
(25, 'Esp32', '<p><strong>Potencia y Versatilidad en un Solo Chip. Perfecto para Proyectos IoT y Domótica.</strong></p><p>El ESP32 es la solución ideal para tus proyectos electrónicos, ofreciendo un rendimiento superior y una amplia gama de funcionalidades. ¡Desata todo el potencial de tus creaciones con este microcontrolador potente y eficiente!</p><p><strong>Aspectos Técnicos:</strong></p><ul><li><strong>Procesador:</strong> Doble núcleo Tensilica Xtensa LX6, hasta 240 MHz</li><li><strong>Memoria:</strong> 520 KB SRAM interna y 16 MB de memoria flash externa</li><li><strong>Conectividad:</strong> Wi-Fi 802.11 b/g/n y Bluetooth 4.2 BLE</li><li><strong>Pines GPIO:</strong> 34 pines GPIO multifuncionales</li><li><strong>Interfaces:</strong> UART, SPI, I2C, I2S, ADC de 12 bits</li><li><strong>Eficiencia Energética:</strong> Modos de ahorro de energía, incluyendo deep sleep con consumo de menos de 5 µA</li><li><strong>Seguridad:</strong> Encriptación hardware, almacenamiento seguro de claves, arranque seguro</li><li><strong>Aplicaciones:</strong> IoT, domótica, wearables, y más</li></ul><p>Descubre la combinación perfecta de potencia y eficiencia con el ESP32, el microcontrolador que llevará tus proyectos de IoT y domótica al siguiente nivel. ¡Haz tu pedido hoy y comienza a innovar con el ESP32!</p>', 250.00, 2, 45, 8, 1),
(29, 'ejemplo', '<p>asdfdasfsadfsa</p>', 50.00, 10, 5, 8, 0),
(30, 'ejemplo', '<p>asdfdasfdas</p>', 500.00, 5, 10, 7, 1);

